//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.18;

import "../../node_modules/@openzeppelin/contracts/utils/Strings.sol";

contract storeContract {

    bytes32[] public hashes;
    uint256 position = 0;
    
    mapping(address => mapping(bytes32 => bool)) contractSignedBy;
    mapping(bytes32 => address) hashedTextby;

    function addSignedContract(string memory contractHash, string memory signature) public {
        require(bytes(signature).length > 0, "Signature length must be larger than zero");
        bytes32 contractHashed = keccak256(abi.encodePacked(contractHash, signature));
        contractSignedBy[msg.sender][contractHashed] = true;
    }

    function getContractSigned(string memory contractHash, string memory signature) public pure returns(bytes32){
        require(bytes(signature).length > 0, "Signature length must be larger than zero");
        bytes32 contractHashed = keccak256(abi.encodePacked(contractHash, signature));
        // return contractSignedBy[msg.sender][contractHashed];
        return contractHashed;
    }

    function hashContract(string memory legalContract) public {
        bytes32 textHashed = keccak256(abi.encodePacked(legalContract));
        hashedTextby[textHashed] = msg.sender; 
    }
}
